document.addEventListener('DOMContentLoaded', function () {
  console.log('Hello Webpack Encore! Edit me in assets/app.js, test webpack');
  var collectionHolder = document.querySelector('#images_container');
  var addButton = document.querySelector('#add_image_button');
  var index = collectionHolder.children.length;
  function addImageForm() {
    var prototype = collectionHolder.dataset.prototype;
    var newForm = prototype.replace(/__name__/g, index);
    index++;
    var newFormElement = document.createElement('div');
    newFormElement.classList.add('image-entry');
    newFormElement.innerHTML = newForm;
    collectionHolder.appendChild(newFormElement);
  }
  addButton.addEventListener('click', function (e) {
    e.preventDefault();
    addImageForm();
  });

  // gère la suppression des images dans le formulaire d'édition des pages en fonction des champs flexibles sélectionnés
  var typeField = document.querySelector('[name$="[type]"]');
  var contentFields = document.querySelectorAll('.block-content');
  console.log(contentFields);
  function toggleContentFields() {
    var selectedType = typeField.value;
    contentFields.forEach(function (field) {
      if (field.classList.contains("block-content-".concat(selectedType))) {
        field.style.display = '';
      } else {
        field.style.display = 'none';
      }
    });
  }
  typeField.addEventListener('change', toggleContentFields);
  toggleContentFields(); // Initial call to set the correct fields on page load
});

